import React from 'react';
import './GameLobby.css'; // Import the CSS for styling

function GameLobby({ players }) {
  return (
    <div className="game-lobby">
      <h2>Game Lobby</h2>
      <div className="game-board">
        {players.map((player, index) => (
          <div key={index} className="player-card" style={{ transform: `rotate(${index * (360 / players.length)}deg) translate(300px) rotate(-${index * (360 / players.length)}deg)` }}>
            <img src={player.profileImage} alt={`${player.name}'s profile`} />
            <h3>{player.name}</h3>
          </div>
        ))}
      </div>
    </div>
  );
}

export default GameLobby;
